import React, { Component } from "react";
import { connect } from "react-redux";
import { login, userIdOnChnage, passwordOnChnage } from "../actions";
class Login extends Component {
  state = {};

  componentDidMount() {
    console.log("Login did mount  this.props", this.props);
  }
  render() {
    return (
      <div className="row mt-5 text-center">
        <div className="col-md-4" />
        <div className="col-md-4 card p-5 ">
          <input
            type="text"
            name="userId"
            value={this.props.userId}
            placeholder="user@gmail.com"
            onChange={e => {
              this.props.userIdOnChnage(e.target.value);
            }}
          />

          <input
            type="password"
            name="password"
            placeholder="Enter your password"
            value={this.props.password}
            onChange={e => {
              this.props.passwordOnChnage(e.target.value);
            }}
          />

          <br />
          <input type="submit" value="login" className="buttonStyle" />
        </div>
        <div className="col-md-4" />
      </div>
    );
  }
}
const mapStateToProps = state => {
  console.log("[State Login component]", state.authentication);
  return state.authentication;
};
export default connect(
  mapStateToProps,
  { login, userIdOnChnage, passwordOnChnage }
)(Login);
